css:
@-moz-document url-prefix('http://www.tumblr.com/'), url-prefix('https://www.tumblr.com/')
{

  .new_post_label
  {
    font-size: 0 !important;
  }

  .new_post_label > I:before
  {
    content: none !important;
  }

  #new_post
  {
    background: url('https://78.media.tumblr.com/025d5d9203e8652295a129e01608d81d/tumblr_owyk1mM73B1w5evufo1_540.png') center no-repeat white !important;
  }
}
